import { base_url } from "../config";

const NewPost = {
  new: (
    namePost,
    content,
    category,
    thumb,
    slugify,
    datetime,
    slide,
    middle,
    gameplay,
    schedule
  ) => {
    return fetch(`${base_url}/newpost`, {
      method: "post",
      headers: {
        "Content-type": "application/json",
      },
      body: JSON.stringify({
        name: namePost,
        content: content,
        category: selectedCategory,
        mainimage: mainimage,
        newness: newName,
        slug: slugify,
        datetime: datetime,
        publicpost: schedule,
      }),
    })
      .then((res) => res.json())
      .then((res) => {
        return res;
      });
  },
};

export default NewPost;
